    <script>
        $(document).ready(function(){
            function findUrl(){
                var get = [];
                if(location.search != ""){
                    location.search.replace('?', '').split('&').forEach(function (val) {
                        split = val.split("=", 2);
                        get[split[0]] = split[1];
                    });
                }
                return get;
                
            }
            function changeUrl(k, v){
                var get = [];
                get = findUrl();
                get[k] = v;    
                //console.log(get);
                var joined = "index.php?";
                for(var i in get){
                    if(get[i] != "false") //s att man inte fr ondiga grejer i URL:en
                        joined = joined + i +"=" + get[i] + "&";
                }
                joined = joined.substring(0, joined.length-1);
                window.location.href = joined;
            }
            
            function getUrl(k){
                var get = [];
                get = findUrl();
                return get[k];
            }
            
