            //fr pirat
            function isKonsonant(c) {
                return ['b','B','c','C','d','D','f','F','g','G','h','H','j','J','k','K','l','L','m','M',
                       'n','N','p','P','q','Q','r','R','s','S','t','T','v','V','w','W','x','X','z','Z'].indexOf(c) !== -1;
            }
            
            function isVokal(c){
                return['a', 'A', 'e', 'E', 'i', 'I', 'y', 'Y', 'o', 'O', 'u', 'U', '', '', '', '', '', ''].indexOf(c) !== -1;
            }
            
            if(getUrl("pirate") == "true"){
                $("body").find("p, h1, h2, span, button").each(function(i){
                    var orgText = $(this).html();
                    var newText = "";
                    for(var i = 0; i < orgText.length; i++){
                        var char = orgText.charAt(i);
                        if(isKonsonant(char)){
                            newText += char + "o" + char;
                        }else{
                            newText += char;
                        }
                    }
                    $(this).html(newText);
                });
            }
            
            //fr fig
            if(getUrl("fig") == "true"){
                $("body").find("p, h1, h2, span, button").each(function(i){
                    var orgText = $(this).html();
                    var newText = "";
                    orgText.split(' ').forEach(function (val){
                        //console.log(val);
                        //splitta orda
                        var left = "";
                        var right = "";
                        for(var i = 0; i < val.length; i++){
                            if(isVokal(val.charAt(i))){
                                left = val.substring(0, i+1);
                                right = val.substring(i+1, val.length);
                                newText = newText + " fi"+right+" "+left+"kon";
                                break;
                            }
                        }
                    });
                    if(newText != "")
                        $(this).html(newText);
                });
            }
            
